ng to lie, dealing with rheumatoid arthritis and endometriosis over the past few years hasn\u2019t always been easy. What keeps me going is my love and passion for the game. I\u2019m also using this gritty personality of mine to my advantage, I suppose \ud83e\udd23. It\u2019s been 7 weeks since surgery, and I am so stoked to get back to competing in two weeks @rolandgarros in a very fabulous @newbalancetennis outfit! I\u2019ve been dedicating so much of my time to the physical side of the game and on court working my craft. But, I\u2019ve also used this time to focus on the continuous inner work as well...Sitting down and getting some of my goals down on my vision board have helped create a bit of a roadmap to guide me in the areas I can improve. Listening to other peoples journeys with similar health challenges have inspired me to rework my nutrition plans and incorporate different integrative techniques. All of this has opened up my eyes to new ideas. Continuing to work on the mental side of my game has been a priority, and personal evolvement has been at the top of the list as well. It\u2019s been really nice being at home with my pups \ud83d\udc36\ud83d\udc36\ud83d\udc36\ud83d\udc36 , sleeping in my bed, doing DIY projects, getting on court with young junior players and helping them with their tennis, and being able to make home cooked meals every morning and night \ud83d\ude0b Can\u2019t wait to share more soon @tennischannel \n\nAnd I got fully vaccinated this week \ud83e\udd73 Let\u2019s go \ud83d\udcaa\ud83c\udffb\ud83d\udcaa\ud83c\udffb\u2708\ufe0f\ud83c\udf0e #roadtorolandgarros"}}]},"edge_media_to_comment":{"count":0},"comments_disabled":true,"taken_at_timestamp":1621216702,"edge_liked_by":{"count":1111},"edge_media_preview_like":{"count":1111},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c157.0.406.406a/186880358_1406446683066716_7986993087254549492_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=10 bloks_app_url":null},"media_overlay_info":null,"media_preview":"ACoq1lHyDHoP5VAsgHvkk9vX3NWIjuQH2qmbaPLHAByTkjPvUjFWXJ4HIJBGT07ew+o9aY12B3jH/As/yFReYibpB94/rjpj+tOSMON3HP8As0kNjGux/fT8Axpv2tP736GpjFj0/wC+RRsHpTEWLK6ikiHOMAA5yOQBnnp+tTyopRmBB4PfI/SsnTDvgdT6nn8B26VbtrYKxdsEKOwI5/kRiqEQiNZOG6n34/8ArU62VyuPm+U46mkkdYYcr3yR+Zx+FRW19MAAWRvYjH+FOQkXirYwd1J5beh/KpY55XUMVXntkg07zW/uH/vr/wCtUlGXpeVibg8ngY68VbaRgpQDGe5/wxmrhGBxTCMjmmIznT5AvoAPpjr+f8qVE45AP1H+FJLwue9WF+4D7U3uC2LFsNseFHcnFS7vY/kP8ait/uD/AD3qWpA//9k=","owner":{"id":"2535296418","username":"danimalcollins"},"is_video":false,"has_upcoming_event":false,"accessibility_caption":"Photo shared by Danielle Collins on September 14, 2021 tagging @veronicabeard. May be an image of one or more people and people standing.","edge_media_to_caption":{"edges":[{"node":{"text":"The Veronica Beard #MakeitHappen campaign is a vibe!  The majority of my life has been dedicated to trying to make it happen on court \ud83c\udfbe The amount of blood, sweat, tears, and passion that I have poured into my tennis career since the time I was seven years old is something that brings me so much happiness and fulfillment. After 20 years of doing this every day, I still have so many more goals and dreams that I\u2019m working towards. One of the most fun parts of my journey is the people I meet along the way. Last week @nyfw I was able to spend some time with the founders of @veronicabeard \ud83d\udc9e I\u2019ve always admired their hard work and creative minds, but after spending more time with them I really love the way they care about and support other women. I look up to both of them and aspire to be like them in so many ways, so being able to be apart of this campaign really means a lot to me. \n\nThe #makeithappen campaign highlights the movers and shakers of various fields, who inspire the brand. These women get up, get it done, live life to the fullest, crave wonder, give back, and make a difference. All of these women are so so cool and have such inspiring stories so check it out @veronicabeard #veronicabeard"}}]},"edge_media_to_comment":{"count":0},"comments_disabled":true,"taken_at_timestamp":1631634221,"edge_liked_by":{"count":2604},"edge_media_preview_like":{"count":2604},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/241801382_620904049069661_9203718372705129998_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=oWmI-f1QivgAX_i7MNl\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=a24553ab67d370def8ca8a540c2b3f15\u0026oe=61A1526D\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s150x150/241801382_620904049069661_9203718372705129998_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=oWmI-f1QivgAX_i7MNl\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=39fda924a0cb8eebc44f880acbcdc347\u0026oe=61A1E62A\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s240x240/241801382_620904049069661_9203718372705129998_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=oWmI-f1QivgAX_i7MNl\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=f63d36128b98a1f9101f1e27a0cbd785\u0026oe=61A09B70\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s320x320/241801382_620904049069661_9203718372705129998_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=oWmI-f1QivgAX_i7MNl\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=5d37f488ce66df51adf044db77899220\u0026oe=61A11352\u0026_nc_sid=7bff83","config_width":320,"config_height":320},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s480x480/241801382_620904049069661_9203718372705129998_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=oWmI-f1QivgAX_i7MNl\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=ad8
